func leftmostBuildingQueries(heights []int, queries [][]int) []int {
    ans := make([]int, len(queries))
    for i, q := range queries {
        a, b := q[0], q[1]
        if a == b {
            ans[i] = a
            continue
        }
        if a > b {
            a, b = b, a
        }
        maxH := heights[a]
        leftmost := -1
        for j := a + 1; j <= b; j++ {
            if heights[j] > maxH {
                maxH = heights[j]
                leftmost = j
                break
            }
        }
        if leftmost == -1 {
            ans[i] = -1
            continue
        }
        for j := leftmost + 1; j <= b; j++ {
            if heights[j] > maxH {
                maxH = heights[j]
                leftmost = j
            }
        }
        ans[i] = leftmost
    }
    return ans
}
